const DiaryView = () => {

    return (
        <div className="DiaryView">
            <div className="DV_inner">
                <div className="DV_inner_img">
                    <img src={process.env.PUBLIC_URL + `assets/emotion/emotion3.png`}/>
                </div>
            </div>
            <div className="DV_inner">
                <p>좋아요</p>
                <p>일자</p>
            </div>
            <div className="DV_inner">
                <p>내용</p>
            </div>
        </div>
    );

}

export default DiaryView;
